const products = (state = initialState, action) => {
	switch (action.type) {
		case 'GET_PRODUCTS': {
			return {
				...state,
				items: action.payload,
			};
		}
		case 'ADD_PRODUCTS':
			let newProduct = {
				id: Date.now(),
				imageUrl: action.payload.imageUrl,
				name: action.payload.name,
				description: action.payload.description,
				price: action.payload.price,
				count: action.payload.count,
				weight: action.payload.weight,
				size: {
					width: action.payload.width,
					height: action.payload.height,
				},
				comments: [],

			};
			const items = [...state.items, newProduct];
			localStorage.setItem('items', JSON.stringify(items));
			return {
				...state,
				items: items,
			};

		case 'EDIT_PRODUCTS': {
			const items = state.items.map((item) => {
				if (item.id === action.payload.id) {
					item.imageUrl = action.payload.imageUrl;
					item.name = action.payload.name;
					item.description = action.payload.description;
					item.price = action.payload.price;
					item.count = action.payload.count;
					item.weight = action.payload.weight;
					item.size.width = action.payload.width;
					item.size.height = action.payload.height;
				}
				return item
			});
			localStorage.setItem('items', JSON.stringify(items));
			return {
				...state,
			};
		}
		case 'REMOVE_PRODUCT': {
			const items = state.items.filter((item) => item.id !== action.payload);
			localStorage.setItem('items', JSON.stringify(items));
			return {
				...state,
				items: items,
			};
		}
		case 'SORT_BY_COUNT_PRODUCT': {
			return {
				...state,
				sortBy: action.payload
			};
		}
		case 'SEARCH_PRODUCTS': {
			return {
				...state,
				search: action.payload,
			};
		}
		case 'GET_COMMENTS': {
			return {
				...state,
				comments: action.payload,
			};
		}
		case 'SET_COMMENTS': {
			const items = state.items.map((item) => {
				if (localStorage.getItem('comment')) {
					const comment = JSON.parse(localStorage.getItem('comment'));
					const comments = comment.filter((comment) => comment.productId === item.id)
					item.comments = comments;
					return item;
				} else {
					const comments = state.comment.filter((comment) => comment.productId === item.id)
					item.comments = comments;
					return item;
				}
			})
			localStorage.setItem('items', JSON.stringify(items));
			return {
				...state,
				items: items,
			};
		}
		case 'ADD_COMMENT': {
			let newComment = {
				id: Date.now(),
				date: action.payload.date,
				productId: action.payload.productId,
				auther: action.payload.auther,
				description: action.payload.description,
			};
			const comment = [...state.comment, newComment];
			localStorage.setItem('comment', JSON.stringify(comment));
			return {
				...state,
				comment: comment,
			};
		}
		default:
			return state;
	}
};
export const getComments = (state = initialState) => {
	const { comment } = state;
	return comment;
}
export const productsListSelector = (state) => {
	const { search, items, sortBy } = state;

	const searchLower = search.toLowerCase();

	return items
		.filter((item) => {
			const nameLower = item.name.toLowerCase();

			return nameLower.indexOf(searchLower) !== -1;
		})
		.sort(function (a, b) {
			return a[sortBy] - b[sortBy];
		});

}

export default products;
